To ensure that the code inside the `useEffect` hook runs only once every 0.6 seconds, you can use a combination of `useRef` and `setTimeout` to manage the timing. Here's how you can modify your code:

```javascript
import { useEffect, useRef } from 'react';

const YourComponent = ({ cursor }) => {
  const $portfolioNext = useRef(null);
  const $portfolioCurrent = useRef(null);
  const timeoutRef = useRef(null);

  useEffect(() => {
    const runAnimation = () => {
      tl.set($portfolioNext.current, {
        clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
      });
      tl.set($portfolioNext.current, {
        css: { backgroundImage: 'url(' + cursor.cursorImage + ')' },
      });

      tl.to($portfolioCurrent.current, {
        clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
        duration: 0.5,
      }, 'start');

      tl.to($portfolioNext.current, {
        clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
        delay: 0.1,
        duration: 0.5,
      }, 'start');

      tl.set($portfolioCurrent.current, {
        clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
      });

      tl.set($portfolioCurrent.current, {
        css: { backgroundImage: 'url(' + cursor.cursorImage + ')' },
      });
    };

    if (timeoutRef.current) {
      clearTimeout(timeoutRef.current);
    }

    timeoutRef.current = setTimeout(runAnimation, 600);

    return () => {
      if (timeoutRef.current) {
        clearTimeout(timeoutRef.current);
      }
    };
  }, [cursor.cursorImage]);

  return (
    <div>
      {/* Your component JSX */}
    </div>
  );
};

export default YourComponent;
```

### Explanation:

1. **useRef for Timeout Management**:
   - `timeoutRef` is used to store the timeout ID so that it can be cleared if the effect runs again before the timeout completes.

2. **runAnimation Function**:
   - The animation logic is encapsulated in the `runAnimation` function.

3. **Timeout Logic**:
   - Before setting a new timeout, the previous timeout is cleared using `clearTimeout(timeoutRef.current)`.
   - A new timeout is set to run the animation after 600 milliseconds (0.6 seconds).

4. **Cleanup**:
   - The cleanup function in the `useEffect` hook ensures that the timeout is cleared when the component unmounts or when the effect runs again.

This approach ensures that the animation code runs only once every 0.6 seconds, even if the `cursor.cursorImage` changes more frequently.

